import React, {Component} from 'react';
import '../App.css';
import {Navbar, Nav, Container} from 'react-bootstrap';
import {AiOutlineHome, AiOutlineUser, AiOutlineExport} from 'react-icons/ai';

export default class MyNav extends Component {
    render(){

        return(
        <div className=' w-100'>

                <Navbar bg="light" variant="light" fixed="top">
                    <Container>
                    <Navbar.Brand className='navTitl' href="/">My_Events</Navbar.Brand>
                        <Nav>
                            <Nav.Link className='icon-hoe' href="/"><AiOutlineHome/></Nav.Link>
                            <Nav.Link className='icon-usr' href="/profil"><AiOutlineUser/></Nav.Link>
                            <Nav.Link className='icon-lo' href="/login"><AiOutlineExport/></Nav.Link>
                        </Nav>
                    </Container>
                </Navbar>
                    {/* <SearchBar/> */}

        </div>

        )
    }
}
